  \"Stillwater National Wildlife Refuge, Stillwater Wildlife Management Area, Anaho
  Island National Wildlife Refuge and Fallon National Wildlife Refuge: Narrative Report:
  1966\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
