  \"stillwater-national-wildlife-refuge-stillwater-wildlife-management-area-anaho-island-natio-53004\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Fallon, Stillwater and Anaho Island
  National Wildlife Refuges are located in northwest Nevada and are administered by
  the refuge administrative office in Fallon, Nevada. Together they comprise the Stillwater
  Wildlife Management Area (SWMA). Water was a case of u201cfeast and famineu201d
  in 1966. For the first two months, all units were full.  As the summer progressed,
  however, hot days and nights kept water consumption above supply.  Excessive salt
  accumulation reduced bulrush growth thus reducing food for ducks. Because of the
  poor water conditions and lack of food, many ducks went to wintering areas without
  stopping over. Botulism occurred only in a mild outbreak.  Development and maintenance
  on the refuge consisted of managing water facilities, improving road conditions
  and maintaining public facilities. The grazing program in 1966 was little changed
  from the previous year and was successful.\",\n\t\"license_title\": \"License Not
